import React, { Component } from 'react';
import ResultsShelf from '../resultsShelf'
import SearchInfo from '../searchInfo'
import data from '../../data/data.json'
import './style.scss'

class ResultsScreen extends Component {
    constructor(props) {
        super(props);
        this.state = {
            searchParams: {
                to: '',
                from: '',
                date: '',
            }
        };
    }

    onSearchClick = (searchParams) => {this.setState(searchParams)};

    render() {
        return (
            <div className='results-screen'>
                <SearchInfo searchParams={this.state.searchParams} onSearchClick={onSearchClick}/>
                <ResultsShelf listings={data.listings} />
            </div>
        )
    }
}

export default ResultsScreen;
